import React from 'react';
import {Section, Title, Container} from './styles'
import { Doughnut } from "react-chartjs-2";




const StatCard = (props) => {
  return (
    <Section>
      <Title>{props.title || "titulo"}</Title>
      <Container>
        <Doughnut
          data={props.items}
          width={320}
          height={500}
          options={{
            maintainAspectRatio: false,
            responsive: true,
            legend: {
              position: "bottom",
              responsive:true
            },
          }}
        />
      </Container>
    </Section>
  );
};

export default StatCard;
